  `catatan` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_detail`),
  KEY `kd_menu` (`kd_menu`),
  KEY `id_order` (`id_order`),
  CONSTRAINT `detail_order_ibfk_1` FOREIGN KEY (`kd_menu`) REFERENCES `menu` (`kd_menu`),
  CONSTRAINT `detail_order_ibfk_2` FOREIGN KEY (`id_order`) REFERENCES `order` (`id_order`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

